        public int LengthOfLongestSubstring(string s)
        {


            string solution = "";
            string cur = "";
            for (int i = 0; i < s.Length; i++)
            {
                cur = "";
                for (int j = i; j < s.Length; j++)
                {
                    //Console.WriteLine("cur:" + cur);
                    //Console.WriteLine("searching from index: " + j);
                    
                    if (!cur.Contains(s[j]))
                    {
                        cur += s[j];
                        if (cur.Length > solution.Length)
                        {
                            solution = cur;
                        }
                    }
                    else
                    {
                        break;
                    }

                }
            }


            Console.WriteLine("Max Substring = " + solution);
            return solution.Length;

        }


